Various coding styles have been used during the history of the codebase, and the result is not very consistent. However, we're now trying to converge to a single style, so please use it in new code. Old code will be converted gradually and you are encouraged to use the provided clang-format-diff script to clean up the patch automatically before submitting a pull request. Basic rules specified in src/.clang-format . Braces on new lines for namespaces, classes, functions, methods. Braces on the same line for everything else. 4 space indentation (no tabs) for every block except namespaces. No indentation for public/protected/private or for namespace. No extra spaces inside parenthesis; don't do ( this ) No space after function names; one space after if, for and while. If an if only has a single-statement then-clause, it can appear on the same line as the if, without braces. In every other case, braces are required, and the then and else clauses must appear correctly indented on a new line. ++i is preferred over i++. Block style example: namespace foo
{
class Class
{ bool Function(const std::string& s, int n) { // Comment summarising what this section of code does for (int i = 0; i < n; ++i) { // When something fails, return early if (!Something()) return false; ... if (SomethingElse()) { DoMore(); } else { DoLess(); } } // Success return is usually at the end return true; }
}
}

